import React, { Component } from "react";
import { connect } from "react-redux";
import PropTypes from "prop-types";
import { addPeoVision } from "../../actions/peo_visions";

export class MapForm extends Component {
  state = {
    peo_vision: ""
  };

  static propTypes = {
    addPeoVision: PropTypes.func.isRequired
  };

  onChange = e =>
    this.setState({
      [e.target.name]: e.target.value
    });
  onSubmit = e => {
    e.preventDefault();
    const { peo } = this.state;
    const peo_vision = { peo };
    this.props.addPeoVision(peo_vision);
  };
  render() {
    const { peo } = this.state;
    return (
      <div>
        <h1>Add peo</h1>
        <form onSubmit={this.onSubmit}>
          <div className="form-group">
            <label>peo</label>
            <input
              className="form-control"
              type="text"
              name="peo"
              onChange={this.onChange}
              value={peo}
            ></input>
          </div>

          <div className="form-group">
            <button type="submit" className="btn btn-primary">
              Submit
            </button>
          </div>
        </form>
      </div>
    );
  }
}

export default connect(null, { addPeoVision })(MapForm);
